import React, { useEffect, useState, useRef } from "react";
import { useSelector } from "react-redux";
import { Image as AntdImage } from "antd";
import dayjs from "dayjs";
import useWebsocket from "@/hooks/useWebsocket";
import { DevicesInfo, MessgeType, drawInfo, METHOD } from "@/types/Socket";
import { playerParse } from "@/utils/dataParse";
import { drawAlarmImage } from "@/utils/drawLines";
import { State } from "@/store/reducer/screenSlice";
import styles from "./alarmInfo.module.scss";
import { getAlarmLev } from "@/utils/commen";

const baseMessage: DevicesInfo = {
  type: MessgeType.REQUEST,
  method: METHOD.GetDeviceInfo,
  seq: 0,
};

export default function AlarmInfo() {
  const socket = useWebsocket("admin");
  const urlRef = useRef<HTMLUListElement | null>(null);
  const { chnListByRegion } = useSelector((state: State) => state.screen);
  const [devicesInfo, setDevicesInfo] = useState<any | null>(null);
  const [imageList, setImageList] = useState<drawInfo[]>([]);
  const [scrollStatus, setScrollStatus] = useState<boolean>(false);
  // useEffect(() => {
  //   let timer = setInterval(() => {
  //       imageList.push({ src: 'data:image/jpeg;base64,', alarmGrade: 1 });
  //       setImageList([...imageList]);
  //     }, 2000)

  //     return () => clearInterval(timer)
  //   }, [])

  useEffect(() => {
    if (socket) {
      socket.onopen = () => {
        sendMessage();
      };
    }
    return () => {
      if (socket) {
        socket.close();
      }
    };
  }, [socket]);

  useEffect(() => {
    if (devicesInfo) {
      getPreview();
    }
  }, [devicesInfo]);

  useEffect(() => {
    // 滚动
    if (urlRef.current && urlRef.current.childNodes[0] && imageList.length) {
      const liHeight = (urlRef.current.childNodes[0] as HTMLLIElement)
        .offsetHeight;
      const ulHeight = urlRef.current.offsetHeight;
      const num = ulHeight / liHeight;
      if (imageList.length > Math.floor(num)) {
        if (!scrollStatus) {
          setScrollStatus(true);
          scroll();
        }
      } else {
        setScrollStatus(false);
      }
    }
  }, [imageList]);

  const sendMessage = () => {
    if (socket) {
      socket.send(JSON.stringify(baseMessage));
      socket.onmessage = (e: MessageEvent) => {
        if (typeof e.data === "string") {
          if (JSON.parse(e.data).body) {
            setDevicesInfo(JSON.parse(e.data));
          }
        } else {
          // if (context) {
          playerParse(e).then((res: any) => {
            // setCurrentAlarmImage(res.src);
            if(!res.jsonData.alarmType) return;
            // 展示图片
            drawAlarmImage(
              res.src,
              res.jsonData.zones,
              res.jsonData.boxes
            ).then((src) => {
              let obj = {
                src,
                ...res.jsonData,
              };
              setImageList((pre) => {
                if (pre.length > 10) {
                  pre.splice(0, 2);
                } else {
                  pre.push(obj);
                }
                return [...pre];
              });
            });
            // if (res.src) {
            //   const img = new Image();
            //   const canvas = document.createElement('canvas');
            //   const ctx: CanvasRenderingContext2D | null = canvas.getContext('2d');
            //   const jsonData: drawInfo = res.jsonData;

            //   if (ctx) {
            //     img.src = res.src;
            //     img.onload = () => {
            //       canvas.width = img.width;
            //       canvas.height = img.height;
            //       const bounds = { width: canvas.width, height: canvas.height };

            //       ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
            //       if (jsonData.zones && jsonData.zones.length) {
            //         // 绘制检测区
            //         drawLinesForZones(ctx, bounds, jsonData.zones);
            //       }

            //       if (jsonData.boxes && jsonData.boxes.length) {
            //         // 绘制报警区
            //         drawLinesForBoxes(ctx, bounds, jsonData.boxes)
            //       }
            //       let obj = {
            //         src: canvas.toDataURL(),
            //         ...res.jsonData
            //       };
            //       setImageList((pre) => {
            //         if (pre.length > 10) {
            //           pre.splice(0, 2);
            //         } else {
            //           pre.push(obj);
            //         }
            //         return [...pre];
            //       })

            //     }
            //   }
            // }
          });
        }
      };
    }
  };

  const scroll = () => {
    if (!urlRef.current) return;
    urlRef.current.scrollTop += 20;
    requestAnimationFrame(scroll);
  };

  const getPreview = () => {
    if (socket) {
      const message = JSON.stringify({
        ...baseMessage,
        method: METHOD.SetAlarmInfo,
        body: {
          chnId: devicesInfo!.body!.chnInfo[0].chnId,
          enable: 1,
        },
      });
      // socket.send(message);
    }
  };

  return (
    <div className={styles.rightBox}>
      <h3>告警记录</h3>

      <ul ref={urlRef} className={styles.wrop}>
        {imageList.map((item, index) => (
          <li className={styles.rightBoxImg} key={index}>
            <div className={styles.imgWrop}>
              <img width={"100%"} height="100%" src={item.src} />
            </div>
            <div className={styles.textWrop}>
              <p>告警等级：{getAlarmLev(item.alarmGrade)}</p>
              {/* <p>所属摄像机：{chnListByRegion.find((channel: any) => channel.id === item.chnId)?.name}</p> */}
              <p>描述：{item.desc}</p>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
